    for num in nums:
        if count1 == 0 and element2 != num:
            count1 += 1
            element1 = num
        elif num == element1:
            count1 += 1
        elif count2 == 0 and element1 != num:
            count2 += 1
            element2 = num
        elif num == element2:
            count2 += 1
        else:
            count1 -= 1
            count2 -= 1
    final_answer = []
    (final_count1, final_count2) = (0, 0)
    for num in nums:
        if num == element1:
            final_count1 += 1
        if num == element2:
            final_count2 += 1
    if final_count1 >= n // 3:
        final_answer.append(element1)
    if final_count2 > n // 3:
        final_answer.append(element2)
    return final_answer if final_answer else [-1]

